import React, { useEffect, useState } from "react";
import axios from "axios";

const App = () => {
  const [message, setMessage] = useState("");

  useEffect(() => {
    axios.get("/api/test")
      .then((response) => setMessage(response.data.message))
      .catch((error) => console.error(error));
  }, []);

  return (
    <div>
      <h1>Family Photo Vault</h1>
      <p>{message}</p>
    </div>
  );
};

export default App;
